import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';
import Table from 'react-bootstrap/Table'
import '../css/medicine.css';




export default class reportList extends Component {
    constructor(props) {
        super(props);

        this.state = {
            reportList:[],
            checkRequests:true,       
        }

        this.handleClick = this.handleClick.bind(this);
       
    }


    handleClick(i, event) {
    /*
        localStorage.setItem("patient",JSON.stringify(this.state.patientList[i]));
        ReactDOM.render(<SelectedPatientHome />, document.getElementById('root'))
    */
        alert(i)
    }

      render() {

        const createlistItems = () => {

            if(this.state.checkRequests)
            {
                const obj = JSON.parse( localStorage.getItem("patient"))
                const user= {
                    contact:obj.contact,
                }
            
                const promise1 = new Promise(function(resolve, reject) {
                    
                    axios.post('http://localhost:4000/getReports',user)
                    .then(res => {
                        resolve(res.data)
                    });
                });
                
                promise1.then((value) =>{
                    console.log(value);
                    if(value!="empty")
                    this.setState({
                        reportList: value,
                        checkRequests:false,
                    });
                });
            
            }

            if(this.state.reportList.length>0)
            {
                return this.state.reportList.map((item, index) => {
                    const { dateadded, model,prediction} = item 
                    return (
                        <tr key={index} onClick={this.handleClick.bind(this, index)}>
                            <td>{index}</td>
                            <td>{dateadded}</td>
                            <td>{model}</td>
                            <td>{prediction}</td>
                        </tr>
                        )
                 })            
            }
            else
            {
                return (
                    <div>
                    </div>
                    );
            }
        }        
      
        const listItems =createlistItems()

        return (
            <div >
                <div>
                    <h3>Report List</h3>
                    <Table>
                    <thead>
                    <td>#</td>
                    <td>Date</td>
                    <td>Type</td>
                    <td>Prediction</td>
                    </thead>
                    <tbody>
                    {listItems}
                    </tbody>
                    
                    </Table>

                </div>

            </div>
            
        )
    }

}
